import React, { Component } from "react";
import App from "./App";
import Contact from "./Contact";
import About from "./About";
import Header from "./Header";
import Questionnaire from "./Questionnaire";


export default class Home extends Component {
    constructor(props) {
        super(props);

        this.state = {
            items:[],
            dataIsLoaded: false
        };
    }

    componentDidMount() {
        fetch("https://my-json-server.typicode.com/cleeclee123/JSONDataTemp")
            .then((res) => res.json())
            .then((json) => {
                
                this.setState({
                    items: json,
                    DataisLoaded: true
            });
        })
    }

    render() {
        const { DataisLoaded, items } = this.state;
        if (!DataisLoaded) 
        return (
            <div>
                <h1> Please wait.... </h1> 
            </div> 
        )
        return (
            <div className = "temp">
                <h1> Fetch data from an api in react </h1>  {
                    items.map((item) => ( 
                    <ol key = { item.id } >
                        Question_ID: { item.question_id }, 
                        Question_Text: { item.question_text },  
                        </ol>
                    ))
                }
            </div>
        );
    }
}
